'''
Test the webapp
'''

import os
import sciris as sc
import covasim.webapp as cw
import covasim as cv
import unittest
import filecmp


class WebAppUnitTests(unittest.TestCase):
    def setUp(self):
        super().setUp()
        pass

    def tearDown(self):
        super().tearDown()
        pass

    def test_get_version(self):
        cw_version = cw.get_version()
        self.assertEqual(f'Version {cv.__version__} ({cv.__versiondate__})', cw_version)

    def test_pars(self):
        sc.heading('Testing parameters')

        pars = cw.get_defaults()

        default_pars = {'sim_pars': {'pop_size': {'best': 10000, 'min': 1, 'max': 20000.0, 'name': 'Population size',
                                                  'tip': 'Number of agents simulated in the model'},
                                     'pop_infected': {'best': 10, 'min': 1, 'max': 20000.0,
                                                      'name': 'Initial infections',
                                                      'tip': 'Number of initial seed infections in the model'},
                                     'rand_seed': {'best': 0, 'min': 0, 'max': 100, 'name': 'Random seed',
                                                   'tip': 'Random number seed (set to 0 for different results each time)'},
                                     'n_days': {'best': 90, 'min': 1, 'max': 180, 'name': 'Simulation duration',
                                                'tip': 'Total duration (in days) of the simulation'}}, 'epi_pars': {
            'beta': {'best': 0.015, 'min': 0.0, 'max': 0.2, 'name': 'Beta (infectiousness)',
                     'tip': 'Probability of infection per contact per day'},
            'web_exp2inf': {'best': 4.0, 'min': 0.0, 'max': 30, 'name': 'Time to infectiousness (days)',
                            'tip': 'Average number of days between exposure and being infectious'},
            'web_inf2sym': {'best': 1.0, 'min': 0.0, 'max': 30, 'name': 'Asymptomatic period (days)',
                            'tip': 'Average number of days between exposure and developing symptoms'},
            'web_dur': {'best': 10.0, 'min': 0.0, 'max': 30, 'name': 'Infection duration (days)',
                        'tip': 'Average number of days between infection and recovery (viral shedding period)'},
            'web_timetodie': {'best': 22.0, 'min': 0.0, 'max': 60, 'name': 'Time until death (days)',
                              'tip': 'Average number of days between infection and death'},
            'rel_symp_prob': {'best': 1.0, 'min': 0.0, 'max': 10, 'name': 'Symptomatic probability multiplier',
                              'tip': 'Adjustment factor on literature-derived values for proportion of infected people who become symptomatic'},
            'rel_severe_prob': {'best': 1.0, 'min': 0.0, 'max': 10, 'name': 'Severe probability multiplier',
                                'tip': 'Adjustment factor on literature-derived values for proportion of symptomatic people who develop severe disease'},
            'rel_crit_prob': {'best': 1.0, 'min': 0.0, 'max': 10, 'name': 'Critical probability multiplier',
                              'tip': 'Adjustment factor on literature-derived values for proportion of people with severe disease who become crtiically ill'},
            'rel_death_prob': {'best': 1.0, 'min': 0.0, 'max': 10, 'name': 'Death probability multiplier',
                               'tip': 'Adjustment factor on literature-derived values for proportion of critically ill people who die'}}}
        self.assertEqual(len(default_pars), len(pars))

    def test_interventions(self):
        sc.heading('Testing interventions')

        int_pars = {
            'social_distance': [
                {'start': 0, 'end': 90, 'level': 80},  # 80%, aggressive
            ],
            'school_closures': [
                {'start': 0, 'end': 90, 'level': 90}
            ],
            'symptomatic_testing': [
                {'start': 45, 'end': 90, 'level': 60}  # 60%
            ]}

        ints = cw.parse_interventions(int_pars)
        print(ints)
        print(len(ints))

        expected_intervs = [cv.InterventionDict('change_beta', pars={'do_plot': None, 'layers': None,
                                                                     'changes': [0.19999999999999996, 1.0],
                                                                     'days': [0, 90]}),
                            cv.InterventionDict('change_beta', pars={'do_plot': None, 'layers': 's',
                                                                     'changes': [0.09999999999999998, 1.0],
                                                                     'days': [0, 90]}), cv.InterventionDict('test_prob',
                                                                                                            pars={
                                                                                                                'do_plot': None,
                                                                                                                'end_day': 90,
                                                                                                                'start_day': 45,
                                                                                                                'test_delay': 1.0,
                                                                                                                'loss_prob': 0.0,
                                                                                                                'test_sensitivity': 1.0,
                                                                                                                'asymp_quar_prob': None,
                                                                                                                'symp_quar_prob': None,
                                                                                                                'asymp_prob': 0.06,
                                                                                                                'symp_prob': 0.6})]
        self.assertEqual(len(expected_intervs), len(ints))

    def test_upload_file(self):
        sc.heading('Testing upload file')

        fname = os.path.join("..", "example_data.csv")
        upload_pars_path = cw.upload_file(fname)
        outcome = filecmp.cmp(fname, upload_pars_path)
        self.assertIs(outcome, True)

